import React from 'react';
import ProblemPage from '../ProblemPage/ProblemPage';

const Problem2 = ({ handleProblemCompletion }) => {
  return (
    <ProblemPage
      problemNumber={2}
      title="eat with your eyes"
      correctAnswer="splotch"
      handleProblemCompletion={handleProblemCompletion}
    >
      <div>
        <img src="/images/Frame 2.png" alt="Problem 2 visual" className="w-full rounded-lg" />
      </div>
    </ProblemPage>
  );
};

export default Problem2;
